import React from "react";
import "./style/privilege.css";

function Privilege() {
  return (
    <>
      <div className="privilege__title">
        <h2>Наши преимущества</h2>
      </div>
      <div className="privilege__cards"></div>
    </>
  );
}

export default Privilege;
